class Base64Images{
    constructor(){}
    image(code){
        console.log(`Base64Images.image('${code}')`);
        var src='';
        switch (code) {
            case 'qt':
                src="data:image/png;base64,";;
                
            case 'avr':
                src= "data:image/png;base64,`;g==";

            default:
                break;
        }
        return src;
    }
}